import Head from 'next/head';
import Navigation from './Navigation';
import Link from 'next/link';

const Layout = (props) => {
    return (<div>
        <Head>
        <meta charSet='utf-8' />
	    <meta http-equiv='X-UA-Compatible' content='IE=edge,chrome=1'/>
	        <title>Adanu | HomePage |inspiring communities together</title>
            <meta name='viewport' content='width=device-width, initial-scale=1, user-scalable=no'/>
            <link rel='shortcut icon' href='favicon.ico' />
            <link href='https://fonts.googleapis.com/css?family=Open+Sans:400italic,600italic,700italic,800italic,400,600,700,800' rel='stylesheet' type='text/css' />
        </Head>
        <header className='green'>
            <Link href='/'><a className='logo yellow'>Adanu</a></Link>
            <a className='mobile hamburger'>Menu</a>
            <Navigation/>
        </header>

        <div className='responsive_wrapper'>
            {props.children}
        </div>
    </div>);
};

export default Layout;
